import ProjManage from "./Logo.png";
import Project from "./Project";
import aim from "./aim.png";
import ai from "./ainspire.jpeg";
import booking from "./booking.png";
import coinflip from "./coinflip.png";


const Projects = () => {
    return (
        <div className="bg-[#ddd] relative min-h-screen justify-center items-center md:w-6/6 max-sm:h-screen max-sm:w-screen h-full flex flex-col lg:flex-row">
            <a className="absolute top-0" id="Projects"></a>
            <h1 className="text-[#333] pt-10 text-5xl top-0 absolute">Projects</h1>
            <section class="grid gap-4 grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 pt-32 xl:pt-14 ">
            <Project image={ProjManage} github="https://github.com/alexnham/ProjManage-back" projManageLink="https://project-6olz.onrender.com/" description="ProjManage is a website I developed where users are able to display their projects. The web application utilizes React.js for the frontend, Node.js and Express.js for the backend, and MongoDB for the backend. Users are able to create their accounts securely and exhibit their creations!"/>
            <Project image={aim}/>
            <Project image={coinflip} description="CoinFlip Simulator, "/>
            <Project image={ai} description="AInspire, my project idea generator utilizes advanced AI technology to provide a diverse range of creative concepts, seamlessly integrating React and Tailwind CSS. It guides users through technical details, catering to both experienced developers and newcomers, enabling them to bring their dream projects to life with the latest tools and features." projManageLink="https://project-6olz.onrender.com/projects/65c5d16757f20d868d4c2864" github="https://github.com/alexnham/projainspire"/>
            <Project image={booking} description="BookManage, my in-house booking system simplifies the booking process by providing an intuitive interface powered by JavaFX and robust data management with MySQL Workbench. Users can effortlessly navigate through the booking process, and an integrated calendar feature helps them stay organized with upcoming appointments." projManageLink="https://project-6olz.onrender.com/projects/65c5d13a57f20d868d4c285c" github="https://github.com/alexnham/bookingsystem"/>
            <Project/>
            <Project/>
            <Project/>
            <Project/>
            <Project/>

            </section>
        </div>

    );
}

export default Projects;
